import { Component } from '@angular/core';

@Component({
  selector: 'app-navigatebar',
  templateUrl: './navigatebar.component.html',
  styleUrls: ['./navigatebar.component.css']
})
export class NavigatebarComponent {
  isShowing: boolean | undefined;

  toggleSidenav() {
    this.isShowing = !this.isShowing;
  }

  callMethods() {
      this.toggleSidenav();
  }
}
<nav class="nav1">
    <div>
        <a routerLink="/" class="h1b">Abi Laundrette</a>
    </div>
    <div>
        <a class="btn1">About Us</a>
        <a class="btn1"> Contact Us</a>
        <a class="btn2">Schedule Pickup</a>
        <a class="btn1">Profile</a>
        <a class="btn1">Logout</a>
    </div>

</nav>
